import React, { useState } from 'react';

function Curriculo() {
  const [nome, setNome] = useState('');
  const [email, setEmail] = useState('');
  const [formacao, setFormacao] = useState('');
  const [subFormacao, setSubFormacao] = useState('');
  const [experiencia, setExperiencia] = useState('');

  const handleFormacaoChange = (e) => {
    setFormacao(e.target.value);
    setSubFormacao(''); // Resetar subformação ao mudar a formação
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`
      Currículo enviado:
      Nome: ${nome}
      E-mail: ${email}
      Formação: ${formacao} - ${subFormacao}
      Experiência Profissional: ${experiencia}
    `);
  };

  return (
    <div id="curriculo" className="curriculo-container">
      <h2>Cadastro de Currículo</h2>
      <form onSubmit={handleSubmit}>
        {/* Nome */}
        <div className="input-group">
          <label>Nome Completo:</label>
          <input
            type="text"
            value={nome}
            onChange={(e) => setNome(e.target.value)}
            required
            placeholder="Digite seu nome completo"
          />
        </div>

        {/* E-mail */}
        <div className="input-group">
          <label>E-mail:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            placeholder="Digite seu e-mail"
          />
        </div>

        {/* Formação */}
        <div className="input-group">
          <label>Formação:</label>
          <select
            value={formacao}
            onChange={handleFormacaoChange}
            required
          >
            <option value="">Selecione sua formação</option>
            <option value="Graduação">Graduação</option>
            <option value="Pós-Graduação">Pós-Graduação</option>
            <option value="Técnico">Técnico</option>
          </select>
        </div>

        {/* Sub-formação - Se a pessoa escolher Graduação ou Pós-Graduação */}
        {(formacao === "Graduação" || formacao === "Pós-Graduação") && (
          <div className="input-group">
            <label>Tipo de {formacao}:</label>
            <select
              value={subFormacao}
              onChange={(e) => setSubFormacao(e.target.value)}
              required
            >
              <option value="">Selecione o tipo</option>
              {formacao === "Graduação" && (
                <>
                  <option value="Bacharelado">Bacharelado</option>
                  <option value="Licenciatura">Licenciatura</option>
                  <option value="Tecnólogo">Tecnólogo</option>
                </>
              )}
              {formacao === "Pós-Graduação" && (
                <>
                  <option value="MBA">MBA</option>
                  <option value="Mestrado">Mestrado</option>
                  <option value="Doutorado">Doutorado</option>
                </>
              )}
            </select>
          </div>
        )}

        {/* Experiência Profissional */}
        <div className="input-group">
          <label>Experiência Profissional:</label>
          <select
            value={experiencia}
            onChange={(e) => setExperiencia(e.target.value)}
            required
          >
            <option value="">Selecione sua experiência</option>
            <option value="Desenvolvedor Frontend - Empresa A">Desenvolvedor Frontend - Empresa A</option>
            <option value="Desenvolvedor Backend - Empresa B">Desenvolvedor Backend - Empresa B</option>
            <option value="Analista de Sistemas - Empresa C">Analista de Sistemas - Empresa C</option>
          </select>
        </div>

        <button type="submit">Enviar Currículo</button>
      </form>
    </div>
  );
}

export default Curriculo;
